package speedprog;

public class Checkprint {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for (int l=0; l <5 ; l++) {
		for (int k = 0; k < 5; k++) {
			for (int j = 0; j < 5; j++) {
				for (int i = 0; i < 5; i++) {
					System.out.print("* ");
				}
				System.out.println();
			} 
			System.out.println();
		}
	}
	}

}
